.dialog-container {
  display: flex;
  justify-content: center;
  align-items: center;
  padding: 20px;
  background: #000;
}

img {
  max-width: 100%;
  max-height: 80vh;
  object-fit: contain;
  border-radius: 8px;
  box-shadow: 0 0 10px #000;
}
